Die Mandoline ist ein seit dem 17. Jahrhundert bekanntes Zupfinstrument europäischer Herkunft aus der Familie der Lauteninstrumente. Von der Mandoline existieren zwei Bauformen, die sich deutlich in der Form des Korpus unterscheiden: 
*  Die klassische Mandoline, auch neapolitanische Mandoline oder Rundmandoline genannt (ähnlich der Mailänder Mandoline), hat eine flache, abgeknickte Decke, keine Zargen und einen schalenförmigen Korpus (damit gehört sie zu den Schalenhalslauten);  
*  die Flachmandoline wird nach aus dem Cistern- oder Geigenbau entlehnten Konstruktionsprinzipien mit Zargen sowie mit flacher oder leicht gewölbter Decke und ebensolchem Boden angefertigt (und ist damit eine Kastenhalslaute). Der Bezug beider Bauformen besteht aus vier Saitenpaaren, die wie bei der Violine in der Quintenreihe g d’ a’ e’’ gestimmt sind. Die Mensur beträgt bei der Prim-Mandoline 32–34 cm, bei der Sekund-Mandoline mit abweichender Stimmung 36–38,5 cm. In Partituren sowie in Besetzungslisten von Musikgruppen und Orchestern ist die Abkürzung mand. für Mandolinen gebräuchlich.
